var directives = angular.module('practitionerPortal.directives', []);

directives.directive('dropdownMultiselect', function(){
    return {
        restrict: 'E',
        scope:{
            model: '=',
            options: '=',
            file: '=',
            pre_selected: '=preSelected'
        },
        template: "<div class='btn-group' data-ng-class='{open: open}'>"+
        "<button class='dropdown-toggle btn btn-large' data-ng-click='open=!open;openDropdown()'>" +
            "<span>{{getButtonText()}}</span>" +
            "<div class='dropdown-arrow'><span class='caret'></span></div></button>"+
        "<ul class='dropdown-menu' aria-labelledby='dropdownMenu'>" +
        "<li><a data-ng-click='selectAll()'><i class='tags-dropdown-icon icon-ok-sign'></i>  Check All</a></li>" +
        "<li><a data-ng-click='deselectAll();'><i class='tags-dropdown-icon icon-remove-sign'></i>  Uncheck All</a></li>" +
        "<li class='divider'></li>" +
        "<li data-ng-repeat='option in options'> <a data-ng-click='setSelectedItem()'>{{option.name}}<span data-ng-class='isChecked(option.id)'></span></a></li>" +
        "</ul>" +
        "</div>" ,
        controller: function($scope){
            $scope.openDropdown = function(){
                $scope.selected_items = [];
                for(var i=0; i<$scope.pre_selected.length; i++){
                    $scope.selected_items.push($scope.pre_selected[i].id);
                }
            };

            $scope.getButtonText = function(){
                return (angular.isDefined($scope.model) && $scope.model.length > 0)
                    ? $scope.model.length + " Selected"
                    : "Select";
            };

            $scope.selectAll = function () {
                if (angular.isDefined($scope.model)){
                    $scope.model = [];
                    angular.forEach($scope.options, function(option){
                        $scope.model.push(option.id);
                    });
                    console.log($scope.model);
                }
            };
            $scope.deselectAll = function() {
                $scope.model=[];
            };
            $scope.setSelectedItem = function(){
                var id = this.option.id;
                if (angular.isDefined($scope.model)){
                    var i = $scope.model.indexOf(id);

                    if (i > -1) {
                        $scope.model.splice(i, 1);
                    }
                    else {
                        $scope.model.push(id);
                    }
                }

                return false;
            };
            $scope.isChecked = function (id) {
                if (angular.isDefined($scope.model) && $scope.model.indexOf(id) > -1) {
                    return 'icon-ok pull-right';
                }
                return false;
            };
        }
    }
});

directives.directive('messagealert', function($parse) {
    return function(scope, element, attrs) {


        var updateTimer = 0;
        function setupMessageBox(){
            showMessage(); //displays message on page load
            jQuery(window).scroll(function() {
                showMessage();
            });
            clearTimeout(updateTimer);
            activateTimer();
        };

        function activateTimer() {
            updateTimer = setTimeout('jQuery(".alert").hide()', 5000);
        }

        function showMessage(){
            element.animate({
                top:jQuery(window).scrollTop() + "px"
            }, {
                queue: false,
                duration:350
            });
        }

        scope.$watch(attrs.selection, function(value) {
            if(value){
                element.show()
                setupMessageBox();
            }
        });
    };
});


directives.directive('bsPopover', ['$parse', '$compile', '$http', '$timeout', '$q', '$templateCache', function($parse, $compile, $http, $timeout, $q, $templateCache) {
    'use strict';

    // Hide popovers when pressing esc
    $("body").on("keyup", function(ev) {
        if(ev.keyCode === 27) {
            $(".popover.in").each(function() {
                $(this).popover('hide');
            });
        }
    });

    return {
        restrict: 'A',
        scope: true,
        link: function postLink(scope, element, attr, ctrl) {

            var getter = $parse(attr.bsPopover),
                setter = getter.assign,
                value = getter(scope),
                options = {};

            if(angular.isObject(value)) {
                options = value;
            }

            $q.when(options.content || $templateCache.get(value) || $http.get(value, {cache: true})).then(function onSuccess(template) {

                // Handle response from $http promise
                if(angular.isObject(template)) {
                    template = template.data;
                }

                // Handle data-unique attribute
                if(!!attr.unique) {
                    element.on('show', function(ev) { // requires bootstrap 2.3.0+
                        // Hide any active popover except self
                        $(".popover.in").each(function() {
                            var $this = $(this),
                                popover = $this.data('popover');
                            if(popover && !popover.$element.is(element)) {
                                $this.popover('hide');
                            }
                        });
                    });
                }

                // Handle data-hide attribute to toggle visibility
                if(!!attr.hide) {
                    scope.$watch(attr.hide, function(newValue, oldValue) {
                        if(!!newValue) {
                            popover.hide();
                        } else if(newValue !== oldValue) {
                            popover.show();
                        }
                    });
                }

                // Initialize popover
                element.popover(angular.extend({}, options, {
                    content: template,
                    html: true
                }));

                // Bootstrap override to provide tip() reference & compilation
                var popover = element.data('popover');
                popover.hasContent = function() {
                    return this.getTitle() || template; // fix multiple $compile()
                };
                popover.getPosition = function() {
                    var r = $.fn.popover.Constructor.prototype.getPosition.apply(this, arguments);

                    // Compile content
                    $compile(this.$tip)(scope);
                    scope.$digest();

                    // Bind popover to the tip()
                    this.$tip.data('popover', this);

                    return r;
                };

                // Provide scope display functions
                scope._popover = function(name) {
                    element.popover(name);
                };
                scope.hide = function() {
                    element.popover('hide');
                };
                scope.show = function() {
                    element.popover('show');
                };
                scope.dismiss = scope.hide;

            });

        }
    };

}]);

directives.directive('bsTooltip', ['$parse', '$compile',  function($parse, $compile) {
    'use strict';

    return {
        restrict: 'A',
        scope: true,
        link: function postLink(scope, element, attrs, ctrl) {

            var getter = $parse(attrs.bsTooltip),
                setter = getter.assign,
                value = getter(scope);

            // Watch bsTooltip for changes
            scope.$watch(attrs.bsTooltip, function(newValue, oldValue) {
                if(newValue !== oldValue) {
                    value = newValue;
                }
            });

            if(!!attrs.unique) {
                element.on('show', function(ev) {
                    // Hide any active popover except self
                    $(".tooltip.in").each(function() {
                        var $this = $(this),
                            tooltip = $this.data('tooltip');
                        if(tooltip && !tooltip.$element.is(element)) {
                            $this.tooltip('hide');
                        }
                    });
                });
            }

            // Initialize tooltip
            element.tooltip({
                title: function() { return angular.isFunction(value) ? value.apply(null, arguments) : value; },
                html: true
            });

            // Bootstrap override to provide events & tip() reference
            var tooltip = element.data('tooltip');
            tooltip.show = function() {
                var r = $.fn.tooltip.Constructor.prototype.show.apply(this, arguments);
                // Bind tooltip to the tip()
                this.tip().data('tooltip', this);
                return r;
            };

            //Provide scope display functions
            scope._tooltip = function(event) {
                element.tooltip(event);
            };
            scope.hide = function() {
                element.tooltip('hide');
            };
            scope.show = function() {
                element.tooltip('show');
            };
            scope.dismiss = scope.hide;

        }
    };

}]);


directives.directive('typeahead', ['$compile', '$q', '$document', 'typeaheadParser', function ($compile, $q, $document, typeaheadParser) {

    var HOT_KEYS = [9, 13, 27, 38, 40];

    return {
        require:'ngModel',
        link:function (originalScope, element, attrs, modelCtrl) {

            var selected;

            //minimal no of characters that needs to be entered before typeahead kicks-in
            var minSearch = originalScope.$eval(attrs.typeaheadMinLength) || 1;
            //expressions used by typeahead
            var parserResult = typeaheadParser.parse(attrs.typeahead);

            //should it restrict model values to the ones selected from the popup only?
            var isEditable = originalScope.$eval(attrs.typeaheadEditable) !== false;

            //create a child scope for the typeahead directive so we are not polluting original scope
            //with typeahead-specific data (matches, query etc.)
            var scope = originalScope.$new();
            originalScope.$on('$destroy', function(){
                scope.$destroy();
            });

            var resetMatches = function() {
                scope.matches = [];
                scope.activeIdx = -1;
            };

            var getMatchesAsync = function(inputValue) {

                var locals = {$viewValue: inputValue};
                $q.when(parserResult.source(scope, locals)).then(function(matches) {

                    //it might happen that several async queries were in progress if a user were typing fast
                    //but we are interested only in responses that correspond to the current view value

                    if (inputValue === modelCtrl.$viewValue) {
                        if (matches.length > 0) {

                            scope.activeIdx = 0;
                            scope.matches.length = 0;

                            //transform labels
                            for(var i=0; i<matches.length; i++) {
                                locals[parserResult.itemName] = matches[i];
                                scope.matches.push({
                                    label: parserResult.viewMapper(scope, locals),
                                    model: matches[i]
                                });
                            }

                            scope.query = inputValue;

                        } else {
                            resetMatches();
                        }
                    }
                }, resetMatches);
            };

            resetMatches();

            //we need to propagate user's query so we can higlight matches
            scope.query = undefined;

            //plug into $parsers pipeline to open a typeahead on view changes initiated from DOM
            //$parsers kick-in on all the changes coming from the view as well as manually triggered by $setViewValue
            modelCtrl.$parsers.push(function (inputValue) {

                resetMatches();
                if (selected) {
                    return inputValue;
                } else {
                    if (inputValue && inputValue.length >= minSearch) {
                        getMatchesAsync(inputValue);
                    }
                }

                return isEditable ? inputValue : '';
            });

            modelCtrl.$render = function () {
                var locals = {};
                locals[parserResult.itemName] = selected || modelCtrl.$viewValue;
                element.val(parserResult.viewMapper(scope, locals) || modelCtrl.$viewValue);
                selected = undefined;
            };

            scope.select = function (activeIdx) {
                //called from within the $digest() cycle
                var locals = {};
                locals[parserResult.itemName] = selected = scope.matches[activeIdx].model;

                modelCtrl.$setViewValue(parserResult.modelMapper(scope, locals));
                modelCtrl.$render();
            };

            //bind keyboard events: arrows up(38) / down(40), enter(13) and tab(9), esc(27)
            element.bind('keydown', function (evt) {

                //typeahead is open and an "interesting" key was pressed
                if (scope.matches.length === 0 || HOT_KEYS.indexOf(evt.which) === -1) {
                    return;
                }

                evt.preventDefault();

                if (evt.which === 40) {
                    scope.activeIdx = (scope.activeIdx + 1) % scope.matches.length;
                    scope.$digest();

                } else if (evt.which === 38) {
                    scope.activeIdx = (scope.activeIdx ? scope.activeIdx : scope.matches.length) - 1;
                    scope.$digest();

                } else if (evt.which === 13 || evt.which === 9) {
                    scope.$apply(function () {
                        scope.select(scope.activeIdx);
                    });

                } else if (evt.which === 27) {
                    evt.stopPropagation();

                    resetMatches();
                    scope.$digest();
                }
            });

            $document.find('body').bind('click', function(){

                resetMatches();
                scope.$digest();
            });

            var tplElCompiled = $compile("<typeahead-popup matches='matches' active='activeIdx' select='select(activeIdx)' "+
                "query='query'></typeahead-popup>")(scope);
            element.after(tplElCompiled);
        }
    };

}])

directives.directive('typeaheadPopup', function () {
    return {
        restrict:'E',
        scope:{
            matches:'=',
            query:'=',
            active:'=',
            select:'&'
        },
        replace:true,
        template: '<div class="dropdown clearfix" ng-class="{open: isOpen()}">   <ul class="typeahead dropdown-menu"> <li ng-repeat="match in matches | limitTo:8" ng-class="{active: isActive($index) }" ng-mouseenter="selectActive($index)"> <a tabindex="-1" ng-click="selectMatch($index)" ng-bind-html-unsafe="match.label | typeaheadHighlight:query"></a> </li>  </ul> </div>',
        link:function (scope, element, attrs) {

            scope.isOpen = function () {
                return scope.matches.length > 0;
            };

            scope.isActive = function (matchIdx) {
                return scope.active == matchIdx;
            };

            scope.selectActive = function (matchIdx) {
                scope.active = matchIdx;
            };

            scope.selectMatch = function (activeIdx) {
                scope.select({activeIdx:activeIdx});
            };
        }
    };
})




directives.directive('activeNav', function($parse) {
    return function(scope, element, attrs) {
        scope.$watch(attrs.activeNav, function(value) {
            $('.nav-btn').removeClass('active');
            $('#'+value).addClass('active');
        });
    };
});

directives.directive('btnAction', function($parse) {
    return function(scope, element, attrs) {
        scope.$watch(attrs.btnAction, function(value) {
            element.button(value)
        });
    };
});

directives.directive('playVideo', function($parse, $window) {
    return function(scope, element, attrs) {
        scope.$watch(attrs.playVideo, function(value) {
            if(value != undefined){
                var v=document.createElement('video');
                if(navigator.userAgent.match(/iPad/i) != null || navigator.userAgent.match(/iPhone/i) != null){
                    $window.open(value.videoMp4,'_blank');
                }else{
                    if(navigator.userAgent.match(/Android/i) != null){
                        element.html('<video id="theVideo" width="720" height="400" autoplay controls><source src="'+value.videoMp4+'">  Your browser does not support the video tag.</video>')
                    }
                    else if(v.canPlayType && v.canPlayType( 'video/webm; codecs="vp8, vorbis"' )){
                        element.html('<video id="theVideo" width="720" height="400" autoplay controls><source src="'+value.videoWebM+'"><source type="video/mp4"  src="'+value.videoMp4+'">  Your browser does not support the video tag.</video>')
                    }
                    else{
                        element.html('<video id="theVideo" width="720" height="400" autoplay controls><source src="'+value.videoWebM+'"><source src="'+value.videoMp4+'">  Your browser does not support the video tag.</video>')
                    }
                }
            }else{
                element.html('')
            }

        });
    };
});

directives.directive('watchAndUpdate', function($parse) {
    return function(scope, element, attrs) {
        scope.$watch(attrs.watchAndUpdate, function(value) {
            // alert(value)
            var found = false
            if(scope.practitioner){
                for(patient in scope.practitioner.Patients){
                    if(scope.practitioner.Patients[patient].name == value || scope.practitioner.Patients[patient].email == value){

                        scope.exerciseList.patient = {name: scope.practitioner.Patients[patient].name, email: scope.practitioner.Patients[patient].email, id:scope.practitioner.Patients[patient].id}
                        found = true
                    }
                }
                if(!found){
                    if(scope.exerciseList.patient)
                        scope.exerciseList.patient = {name: scope.exerciseList.patient.name, email: scope.exerciseList.patient.email}
                }
            }
        });
    };
});


directives.directive('modalAction', function($parse) {
    return function(scope, element, attrs) {
        scope.$watch(attrs.modalAction, function(value) {
            if(value != undefined){
                element.modal(value)
            }
        });
    };
});


